import React from 'react';
import './App.css';
import PersonalInfo from './PersonalInfo';
import Projects from './Projects';
import Courses from './Courses';
import logo from './logojl.png';
function App() {
    return (
        <Router>
            <div className="App">
                <div className="Header">
                  <img src={logo} className="Logo" alt="logo" />
                </div>
                <div className='main-page-container'>
                    <h1 className="Title">Hi,</h1>
                    <h1 className="Title">I'm Jerry,</h1>
                    <h1 className="sub-Title">Third Year @UChicago</h1>
                    <p className="Intro">I am  majoring in Computer Science, Math, and Statistics. So far, I've explored from data analysis, AI, to trading and software engineering. My goal is to become a skilled tech person and contribute to the tech community, by being kind, thoughtful, and strong.</p>
                    <div className="Links">
                        <Link to="/personalinfo">Personal Info</Link>
                        <Link to="/projects">Projects</Link>
                        <Link to="/courses">Courses</Link>
                    </div>
                </div>

                <Routes>
                    <Route path="/personalinfo" element={<PersonalInfo />} />
                    <Route path="/projects" element={<Projects />} />
                    <Route path="/courses" element={<Courses />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
